import React from "react";
import "./timeColumn.scss";
export default function TimeColumn() {
  // hours = [1, 2, ... 24]
  const hours = Array.from(Array(10), (_, i) => i + 1);

  return (
    <div className="time-column">
      {hours.map((hour) => (
        <div className="time-marker">{hour}</div>
      ))}
    </div>
  );
}
